import React, { useState } from 'react';
import ReactDOM from 'react-dom';

const currTime=()=>{
    return new Date().toLocaleTimeString();
}

const App = () =>{
    const state=useState();

    const [currTime,setState]=useState(currTime);

    const GetTime=()=>{
        setState(currTime)
    }
return(
    <>
    <h1>{currTime}</h1>
    <button onClick={GetTime}>Get Time</button>
    </>
)
}

export default App;
